import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import Home from './Home';
import Recipes from './Recipes';

class Dashboard extends Component {
  constructor() {
    super();

    this.state = {
      message: "",
      LoginStatus: false,
      result: [],
      query: ""
    }
  }
onFormSubmit(event) {
  this.setState({query: this.state.value});
  event.preventDefault();
}

  render() {
    return(
      <Router>
        <div>

          <nav className="nav-list_container">
            <button className="dashboard-item">
              <Link to="/"  className="dashboard-link">Home</Link>
            </button>
            <form onSubmit={this.onFormSubmit}>
              <input name="query" value={this.state.query} onChange={this.onInputChange} placeholder="Enter a movie title" type="text" className="form-input"/>
            </form>

          </nav>

          <Route path="/" exact component={Home} />
        </div>
      </Router>
    )
  }


}

export default Dashboard;
